  }));
};

UilAlignCenterH.propTypes = {
  color: PropTypes.string,
  size: PropTypes.oneOfType([PropTypes.string, PropTypes.number]),
};

UilAlignCenterH.defaultProps = {
  color: 'currentColor',
  size: '24',
};

export default UilAlignCenterH;
